{"3": ["Заказал один раз, приехал разбитый, второй раз заказал, такой же отправили, ещё и грязный", "2021-02-19T15:33:49Z", "livery\":fa", "0", 0, 1, 1, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "9": ["Пришёл целым, без повреждений и царапин, пластик на вид прочный, металлические замки работают исправно, по размеру хороший. В целом довольна, брала на подарок. ", "2021-01-20T16:47:37Z", "синий", "0", 1, 0, 5, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "12": ["Отличный ящик, пришло все в целости и сохранности. Упакован был в коробку, за что отдельное спасибо! Очень довольны покупкой. Ждали только дольше чем заявленно, но это и понятно ....новогодние праздники. ", "2021-01-03T11:42:58Z", "синий", "0", 1, 0, 5, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "20": ["Неужели нельзя убрать сломанный товар, всем один и тот же ящик привозят? Конечно, возврат!", "2020-12-17T10:13:41Z", "синий", "0", 1, 0, 1, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "32": ["Ящик пришел расколотый,замки выпали,да и некоторых частей замков не хватало, коробка была заклеена,выпасть не могли, получается изначально отправлено в сломанном виде", "2020-08-29T06:22:11Z", "синий", "0", 1, 0, 2, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "33": ["Заказ два, оба были без в отличном состоянии, хорошие и по разумной цене.", "2020-08-27T15:02:37Z", "синий", "0", 1, 0, 5, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "34": ["Ящик отличный!!!", "2020-07-23T11:47:42.545333252Z", "синий", "0", 1, 0, 5, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "36": ["Ящик нормальный. При выдаче не стал распаковывать, хотел в подарок! Открыли. Ящик разбит!! Это как надо кидать, чтобы так разбить. И главное упаковка целая. Спасибо вам добрые люди", "2020-07-15T12:58:57.758569391Z", "синий", "0", 2, 0, 5, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "45": ["Ящик пластмассовый, Пришёл с царапинами, возможно из-за повреждения коробки, в которой он пришёл. Сам ящик ничем не обман (целоваться, пупырышками..). Обклеена коробка обычным скотчем. Сам ящик для хранения инструмента мне понравился, много отделов для хранения всякой мелочи и есть объмный внутри отсек для хранения крупногабаритных инструментов. В прошлый раз пришёл такой ящик с про битым углом пластмассы и сломанным замком. С этой же стороны была сорвана и из мята часть коробки. Вопрос к Фасовщик магазина: Вы когда отправляете товар, заботитесь о том, чтобы товар дошёл до потребителя в надлежащем виде? Неверное - нет. Вы портите репутацию интернет магазину Валдберис!", "2020-03-11T21:28:15.493828851Z", "синий", "0", 5, 0, 3, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "47": ["Купила мужу на подарок, быстро забрала и не заметила всей \"роскоши\".. во-первых,  это оказывается не первый возврат, потому что на коробке уже было указано ВОЗВРАТ, складывается вопрос, ПОЧЕМУ ПОСЛЕ ВОЗВРАТА НЕ ПРОВЕРЯЮТ СОТРУДНИКИ ДЕФЕКТЫ И НЕ УСТРАНЯЮТ ТАКИЕ ТОВАРЫ!!!!!! Во-вторых, ПОЧЕМУ после стольких здесь комментариев люди заказывают одно и тоже и все по кругу возвращают???!!!!прошу не учитывать процент выкупа", "2020-03-02T09:08:58.682406304Z", "синий", "0", 5, 0, 1, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "55": ["Пришел поломанный.", "2020-01-12T12:09:35.518938138Z", "синий", "0", 2, 0, 5, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "56": ["Ящик для инструментов хороший,большой,удобный,НО при транспортировке откололась часть верхней крышки.Вопрос:кому надо так плохо упаковывать хорошую,довольно дорогую вещь?Ящик пришел просто в картонной тонкой коробке.Ну хотя бы картон был бы поплотнее,экономия на упаковке,а в итоге испорченный товар.Прошу обратить внимание производителя,ведь это уже не первое  обрашение по поводу такой доставки.Прошу не снимать процент выкупа за возврат товара.", "2020-01-09T07:03:00.849374034Z", "синий", "0", 3, 0, 5, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "58": ["Брак,. Возврат. Были большие надежды, для подарка мужу,увы. Растроенные понесли обратно. Не учитывать % от возврата.", "2020-01-02T08:55:48.423459036Z", "синий", "0", 2, 1, 1, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "59": ["Ящик класный, но с дефектами.Видимо один и тот же всем привозят.", "2019-12-30T20:41:56.844799454Z", "синий", "0", 2, 0, 5, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "61": ["Ящик пришёл со сколом на крышке. Снимите его уже с продажи - столько отзывов об одном и том же браке. Один и тот же гуляет по пунктам выдачи. Как только кто-то отказывается, сразу появляется в наличии.", "2019-12-16T13:08:30.121952767Z", "синий", "0", 1, 0, 3, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "62": ["При получении был обнаружен дефект", "2019-12-15T17:05:28.145341649Z", "синий", "0", 1, 0, 1, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "64": ["Ящик хороший вместительный но пришел с браком скол на крышке обидно", "2019-11-20T05:42:55.730155433Z", "синий", "0", 1, 0, 4, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "65": ["Ящик пришёл в плачевном состоянии, отколотый край и по середине трещина до самого дна, поэтому отказ.Прошу не считать в процент выкупа!Фотографии сделал на месте, но по каким то причинам, не могу прикрепить к отзыву.Выдаёт ошибку", "2019-11-15T18:51:56.524524946Z", "синий", "0", 1, 0, 5, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "66": ["Отличный оргонайзер, муж доволен. Всё целое.", "2019-10-18T10:18:05.372900165Z", "синий", "0", 1, 0, 5, "Ящик для инструментов c металлическим замком 480мм (19\")", "Инстрапласт"], "68":